import React, {useState} from 'react';
import * as cal from './Heading.jsx';
import contact from './contacts.js'
import './index.css'

var [numberz, setNumber] = useState(new Date().getSeconds())
function App() {
    return contact.map( contact => 
      <cal.Cardz 
      key = {contact.id}
      id = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email}
      />)
      
      // const [c,d] = contact
 //setInterval ( () => {setNumber(numberz = new Date().getSeconds())});
}
export default App;
